import FinanceItem from "./components/FinanceItem";

function App() {
  const financeItems = [
    {
      id: "111",
      title: "Book",
      date: new Date(2021, 29, 8),
      price: 250,
      currency: "CZK",
    },
    {
      id: "112",
      title: "Drink",
      date: new Date(2021, 22, 8),
      price: 120,
      currency: "CZK",
    },
    {
      id: "113",
      title: "Mobile",
      date: new Date(2021, 27, 7),
      price: 19999,
      currency: "CZK",
    },
  ];

  let financeItemsJSX = financeItems.map((fi) => (
    <FinanceItem
      title={fi.title}
      date={fi.date.toISOString}
      price={fi.price}
      currency={fi.currency}
    ></FinanceItem>
  ));

  return <div>{financeItemsJSX}</div>;
}

export default App;
